Rules.InvariantScript:
If(
    !IsBlankOrError(
        AzureDevOps.GetQueryResultsV2(
            "one",
            TrackRequestComponent.DevOpsQueryID,
            "msazure"
        ).value
    ),
    ClearCollect(
        clln_AzureDevOps,
        ShowColumns(
            Filter(
                AddColumns(
                    AzureDevOps.GetQueryResultsV2(
                        "one",
                        TrackRequestComponent.DevOpsQueryID,
                        "msazure"
                    ).value,
                    "UserPrincipalEmail",
                    Match(
                        'System.CreatedBy',
                        "<(?<email>.+)>"
                    ).email,
                    "DisplayName",
                    First(
                        ForAll(
                            Split(
                                'System.CreatedBy',
                                "<"
                            ),
                            {Result: ThisRecord.Value}
                        )
                    ).Result
                ),
                'System.State' = dpdn_State_TRC.Selected.name || 'System.State' = dpdn_State_TRC.Selected.option || dpdn_State_TRC.Selected.name in "Select All",
                Lower(dpdn_RequestTypeTRC.Selected.name) in Lower('System.Title') || dpdn_RequestTypeTRC.Selected.name in "Select All",
                TrackRequestComponent.IsAdmin || UserPrincipalEmail = User().Email
            ),
            "UserPrincipalEmail",
            "DisplayName",
            "System.Id",
            "System.State",
            "System.Title"
        )
    );

);

Table(
    {
        name: "Select All"
    },
    {
        name: "Scorecard Type Onboarding"
        
    },
    {
        name: "Feature Request"
        
    }
)

Table(
    {
        name: "Select All",
        option: ""
    },
    {
        name: "New",
        option: "New"
    },
    {
        name: "Active",
        option: "Active"
    },
    {
        name: "Approved",
        option: "Committed"
    },
    {
        name: "Rejected",
        option: "Rejected"
    },
    {
        name: "In Progress",
        option: "In Progress"
    },
    {
        name: "In Review",
        option: "In Review"
    }
    /*,
    {
        name: "Done",
        option: "Done"
    }
    */
)

Ungroup(//Ungroup function to add a Row Number column.
    ForAll(
        Sequence(
            CountRows(
                Search(
                    clln_AzureDevOps,
                    Trim(ti_Search_Request_TRC),
                    "DisplayName",
                    "UserPrincipalEmail"

                )
            )
        ),
        {
            Record: Table(
                Last(
                    FirstN(
                        Search(
                            clln_AzureDevOps,
                            Trim(ti_Search_Request_TRC),
                            "DisplayName",
                            "UserPrincipalEmail"
                        ),
                        Value
                    )
                )
            ),
            RowNumber: Value
        }
    ),
    "Record"
)

If(
    !IsBlankOrError(
        AzureDevOps.GetQueryResultsV2(
            "one",
            TrackRequestComponent.DevOpsQueryID,
            "msazure"
        ).value
    ),
    ClearCollect(
        clln_AzureDevOps,
        ShowColumns(
            Filter(
                AddColumns(
                    AzureDevOps.GetQueryResultsV2(
                        "one",
                        TrackRequestComponent.DevOpsQueryID,
                        "msazure"
                    ).value,
                    "UserPrincipalEmail",
                    Match(
                        'System.CreatedBy',
                        "<(?<email>.+)>"
                    ).email,
                    "DisplayName",
                    First(
                        ForAll(
                            Split(
                                'System.CreatedBy',
                                "<"
                            ),
                            {Result: ThisRecord.Value}
                        )
                    ).Result
                ),
                TrackRequestComponent.IsAdmin || UserPrincipalEmail = User().Email
            ),
            "UserPrincipalEmail",
            "DisplayName",
            "System.Id",
            "System.State",
            "System.Title"
        )
    );
    
);
